环境变量：jd_wx_draw_url // 活动链接
        jd_wx_draw_notify // 是否推送通知（true/false），默认不推送
        jd_wx_draw_opencard // 是否入会（true/false），默认不入会
        jd_wx_draw_conc // 是否启用并发模式（true/false），默认不开启
        jd_wx_draw_conc_threads // 控制并发线程数（正整数），默认3
